Ƌ terminalia
. Epandrium separated from tergite 5 by syntergosternite 8, which has 2 spiracles; tergite 6 absent. Sternite 6 absent. Surstylus absent, i.e. fused to epandrium without trace (
Fig. 92
). Cercal plate (
Fig. 93
) moderately divided. Hypandrium attached at lower anterior corner of inner side of epandrium via an apparent praegonite, with 3 setae at posterior end; posterior attachment of hypandrial+phallic complex made by an extension from base of phallus to wall of epandrium close to inner dorsal tip of cercal plate (
Fig. 94
). Phallic complex (
Fig. 94
): an apparent praegonite present, appearing at first sight to be a surstylus (
Figs 92, 94
) but firmly fused along its base to hypandrium and only loosely attached to epandrium from which it easily detaches during dissection; postgonite hook-like; phallapodeme enlarged, extending anteriorly over hypandrium and fused to it at mid-length by a plate; phallus simple, fully sclerotised, with no apparent juxta or spinulation, with a rod-like projection at midlength anteriorly which is asymmetrically bifid apically, with a posterior extension that attaches to cercal plate.

